description:
&quot;Uptight bride-to-be Evelyn reluctantly attends the bachelorette party thrown for her by wild child sister-in-law, Alison. While Evelyn s disapproving friend Zoe cringes at the gifts of dildos and vibrators, flower-child Jessie suggests a friendly game of Truth or Dare. But when the stripper-gram girl Chastity Lynn arrives to give a lap dance to the blushing bride, the truth about Evelyn s secret desire is finally revealed. Written and directed by Nica Noelle&quot;

Sensi Pearl, Jessie Andrews, Chastity Lynn, Evelyn Lin, Zoe Voss, Alison Tyler, Taylor Vixen, Ella Milano

